import React from 'react';

function Chart(props) {
	const chartData = [
		{ month: 'Jan', value: 0 },
		{ month: 'Feb', value: 0 },
		{ month: 'Mar', value: 0 },
		{ month: 'Apr', value: 0 },
		{ month: 'May', value: 0 },
		{ month: 'June', value: 0 },
		{ month: 'Jul', value: 0 },
		{ month: 'Aug', value: 0 },
		{ month: 'Sep', value: 0 },
		{ month: 'Oct', value: 0 },
		{ month: 'Nov', value: 0 },
		{ month: 'Dec', value: 0 },
	];
	return <div></div>;
}

export default Chart;
